// AdminPage.js
import React, { useState, useEffect } from 'react';
import userServiceInstance from '../UserService';

const AdminPage = () => {
    const [users, setUsers] = useState([]);
    const [admin, setAdmin] = useState({ username: 'administrador', password: '123456' });

    useEffect(() => {
        userServiceInstance.adminLogin(admin).then(response => {
            setUsers(response.data);
        }).catch(error => {
            console.error("Error al obtener los usuarios: ", error);
        });
    }, []);

    return (
        <div>
            <h1>Admin Panel</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Username</th>
                        <th>Email</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.username}</td>
                            <td>{user.email}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default AdminPage;
